import React from 'react';
import {Link} from '../../routes';

const IndexView = () => {

    return (
        <>
            <h1>Welcome to TestPage</h1>
            <nav>
                <ul>
                    <li>
                        <Link route={"/style"}>
                            <a>Style Test</a>
                        </Link>
                    </li>
                </ul>
            </nav>
        </>

    )
}

export default IndexView;
